import Chessboard from "./chess";

const Meme =()=>{
    return(
        <div>
        <div className="box">
                <div className="card">
                    <div className="image"></div>
                    <div>How relatable xD</div>
                </div>
            </div>
            <Chessboard />
        </div>

        
    );

}

export default Meme;
